import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

class NavigationPage extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
             <nav className="navbar navbar-expand-lg navbar-light bg-dark">
                 <Link className="navbar-brand" to="/">{this.props.project}</Link>
                 <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                     <span className="navbar-toggler-icon"></span>
                 </button>
                 <div className="collapse navbar-collapse" id="navbarSupportedContent">
                 <ul className="navbar-nav mr-auto">
                 <li className="nav-item">
                     <Link className="nav-link" to="/props-demo">Props Demo</Link>
                 </li>
                 <li className="nav-item">
                     <Link className="nav-link" to="/state-demo">State Demo</Link>
                 </li>
                 <li className="nav-item">
                     <Link className="nav-link" to="/lifecycle-demo">Life Cycle Demo</Link>
                 </li>
                 </ul>
                 </div>
             </nav>
            // <>
            // <Navbar bg="dark" variant="dark">
            //     <Navbar.Brand href="/">Navbar</Navbar.Brand>
            //     <Nav className="mr-auto">
            //         <Nav.Link href="/props-demo">Props Demo</Nav.Link>
            //         <Nav.Link href="/state-demo">State Demo</Nav.Link>
            //         <Nav.Link href="/lifecycle-demo">Life Cycle Demo</Nav.Link>
            //     </Nav>
            // </Navbar>
            // </>
        );
    }

}

export default NavigationPage;
